import User from '../../../models/user';
import mailer from '../../../mailer';

export default {

    async index(req, res, next) {
        try {
            User.findOne({ "email" : req.query.email})
            .then((user)=>{
                res.status(200).send({ message:"successful", data: user})
            })
        } catch (error) {
            res.status(400).send(error)
        }
    },

    async login(req, res, next) {
        //Login a registered user
        try {
            const { email, password } = req.body
            const user = await User.findByCredentials(email, password)
            const token = await user.generateAuthToken()
            if (!user) {
                return res.status(401).send({error: 'Login failed! Check authentication credentials'})
            }
            res.status(200).json({ message:"successfully",token})
            // res.send({ user , token})
        } catch (error) {
            res.status(400).json({ error: 'Login failed! Check authentication credentials'})
        }
    },

    async register(req, res, next) {
        //Login a registered user
        try {
            const { firstName , lastName, email , password } = req.body
            const user = new User({
                firstName: firstName,
                lastName: lastName,
                email: email,
                password: password
            })
            const token = await user.generateAuthToken()
            await user.save().then((user) => {
                if(user){
                    res.status(200).json({ msg: "successfully", data: user , token})
                    mailer.sendEmployeePassword(user.email)
                }
            })
            .catch((error) => {
                res.status(400).json({ msg: "already registered email" ,error})
            })
        } catch (error) {
            res.status(400).json({ msg: "Already registered email"})
        }
    },

};

